    data: |
      SELECT DISTINCT - COUNT ( * ) + 89 AS col0, CASE COUNT ( * ) WHEN + + 30 + + + 57 THEN NULL WHEN + 32 * + + 52 THEN - + MAX ( DISTINCT - + 16 ) ELSE - 68 END;

outputs:
  - name: q14419.out
    data: |
      88	-68
